import React, {Component} from 'react';
import './ErrorComponent.scss';

export class Errorcomponent extends Component {
    render() {
        const { message } = this.props;
        return(
            <div className={"errorTxtContainer"}>
                <h1>Whoops! Something is wrong!</h1>
                {message}
            </div>
        );
    }
}
